<template>
  <div>
    <div style="margin:20px 0;">
      <pdf ref="myPdfComponent" style="display:none" :src="url"></pdf>
      <pdf v-for="i in numPages" :key="i" :src="url" :page="i"></pdf>
    </div>
    <el-row>
      <el-col :span="4" :offset="10">
        <el-button size="large" class="button-right" @click="pdfPrintAll">打印</el-button>
      </el-col>
    </el-row>
  </div>
</template>
<script>
import pdf from "vue-pdf";
export default {
  components: {
    pdf
  },
  name: "Index",
  data() {
    return {
      src: "",
      numPages: undefined,
      currentPage: 1,
      pageCount: 1,
      url: ""
    };
  },
  methods: {
    pdfPrintAll() {
      this.$refs.myPdfComponent.print();
    },
    dataURLtoBlob: function(dataurl) {
      var bstr = atob(dataurl);
      var n = bstr.length;
      var u8arr = new Uint8Array(n);
      while (n--) {
        u8arr[n] = bstr.charCodeAt(n);
      }
      return new Blob([u8arr], { type: "pdf" });
    }
  },
  mounted: function() {
    let data =
      "";
    let URL = this.dataURLtoBlob(data);
    var reader = new FileReader();
    reader.readAsDataURL(URL);
    var that = this;
    reader.onload = function(e) {
      // 兼容IE
      if (window.navigator.msSaveOrOpenBlob) {
        var bstr = atob(e.target.result.split(",")[1]);
        var n = bstr.length;
        var u8arr = new Uint8Array(n);
        while (n--) {
          u8arr[n] = bstr.charCodeAt(n);
        }
        var blob = new Blob([u8arr]);
        window.navigator.msSaveOrOpenBlob(blob, "征信报告.pdf");
      } else {
        that.url = e.target.result;
        that.src = pdf.createLoadingTask(e.target.result);
        that.src.promise.then(pdf => {
          that.numPages = pdf.numPages;
        });
      }
    };
  }
};
</script>
